Muy emocionado de finalmente poder compartirles el Trailer Oficial de mi nueva película “ En Brazos de un Asesino “ #enbrazosdeunasesino  basada en el libro “ Killing Sarai “ escrito por J.A. Redmerski. Quiero agradecerles a todos los que fueron parte de este gran elenco, todos los que fueron parte de esta gran Produccion  que dieron todo lo mejor de ellos para hacer posible este sueño. Gracias a todos nuestros socios por confiar en nosotros. Este Filme marca el primer paso hacia una visión de la cual estoy muy emocionado- crear más oportunidades para los Latinos en Cine y Televisión y llevarles a nuestro público Hispano películas en nuestro Idioma. Los quiero. Les agradezco todo el cariño que siempre me han brindado. Esto es para ustedes. 
I am so proud and excited to share the official trailer for my new film, “En Brazos de un Asesino”. Based on the Novel “ KillingSarai “ written by J.A. Redmerski. Thank you to our incredible cast, crew, and partners who gave their all to this project. This film marks the first step towards the vision that I am so passionate about - to create opportunities for Latinos in film, and to create great films for Latinos everywhere.
